value.type:
type stats = {
  nodes : int;
  leafs : int;
  skips : int;
  depth : int;
  width : int;
}

entries.desc:
type 'a t = {
  uid : int;
  name : string;
  origin : origin option;
  repr : 'a Repr.ty;
  mutable state : 'a;
}

type 'a t = {
  ht : (key * 'a) Q.node HT.t;
  q : (key * 'a) Q.t;
  mutable cap : cap;
  mutable w : int;
}

type reporter = {
  report :
    'a 'b.
      Logs.src ->
      Logs.level ->
      over:(unit -> unit) -> (unit -> 'b) -> ('a, 'b) Logs.msgf -> 'b;
}

type 'a key = {
  name : string;
  doc : string option;
  docv : string option;
  docs : string option;
  ty : 'a Repr__Type.t;
  default : 'a;
  to_univ : 'a -> exn;
  of_univ : exn -> 'a option;
}
